def handleDoubleUnconditionalJumps():
    address_array = findBytes(currentProgram.getMinAddress(), b'\x75.\x74.', 1000)
    address_array += findBytes(currentProgram.getMinAddress(), b'\x74.\x75.', 1000)
    for addr in address_array:
        jmp_bytes = getBytes(addr, 4)
        if jmp_bytes[1] - jmp_bytes[3] == 2:
            clearListing(addr)
            dis.disassemble(addr, None)
            patch_instruction = bytearray()
            patch_instruction.append(0xeb)
            patch_instruction.append(jmp_bytes[1])
            patch_instruction.append(0x90)
            patch_instruction.append(0x90)
            patch_instruction2 = bytes(patch_instruction)
            clearListing(addr)
            clearListing(addr.add(2))
            clearListing(addr.add(3))
            block = mem.getBlock(addr)
            block.putBytes(addr,patch_instruction2 )
            dis.disassemble(addr, None)
            jmp_instr = getInstructionAt(addr)
            new_jmp = jmp_instr.getDefaultFlows()[0]
            new_jmp2 = new_jmp
            for i in range(50):
                 clearListing(new_jmp2)
                 new_jmp2 = new_jmp2.add(1)
                 if new_jmp2.getAddress == currentProgram.getMaxAddress():
                     break
            
            dis.disassemble(new_jmp, None)
                            
            
            
      
 
def decryptShellcode(size, xor_key, rva):
    va = rva + 0x400000
    va = hex(va)[2:]
    addr = toAddr(va)
    addr2 = addr
    enc = get_bytes(toAddr(va), size)
    for i in range(size):
            clearListing(addr2)
            addr2 = addr2.add(1)
    size2 = size
    for i in range(0,size):
        enc[i] = enc[i]^xor_key
        
            
    for i in enc:
       i = i & 0xFF
       setByte(addr, i)
       addr = addr.add(1)
       
   
def get_bytes(addres, size):
    return bytearray(map(lambda b : b & 0xFF,getBytes(addres, size)))    
    

         
def finddShellcodeandkey():
   
        refs = getReferencesTo(toAddr('004011f5'));
        refs+= getReferencesTo(toAddr('00402b58'));
        options = DecompileOptions()
        monitor = ConsoleTaskMonitor()
        ifc = DecompInterface()
        ifc.setOptions(options)
        ifc.openProgram(currentProgram)
        for xref in refs:
            try:
                i = xref.getFromAddress()
                func = getFunctionContaining(i)
                print(func)
                if func == None:
                    dis.disassemble(i, None)
                    createFunction(i, str(i))
               
                func = getFunctionContaining(i)
                print(func)
                res = ifc.decompileFunction(func, 60, monitor)
                high_func = res.getHighFunction()
                pcodeOps = high_func.getPcodeOps(i)
                op = pcodeOps.next()
                param = op.getInputs()
                size = str(param[1]).split(",")
                size = size[1]
                size = int(size.lstrip(), 16)
                xor_key = str(param[2]).split(",")
                xor_key = xor_key[1]
                xor_key = int(xor_key.lstrip(), 16)
                rva = str(param[3]).split(",")
                rva = rva[1]
                rva = int(rva.lstrip(), 16)
                va = rva + 0x400000
                va = hex(va)[2:]
                addr = toAddr(va)
                addr2 = addr
                if rva not in rva_array:
                    for i in range(size):
                         clearListing(addr)
                         addr = addr.add(1)
                    rva_array.append(rva)
                    decryptShellcode(size, xor_key, rva)
                    dis.disassemble(addr2, None)
            except:
                print("Failed finding shellcode for "+str(i))
                continue
            
        
        
