def otherShellcode():
    enc_addr = toAddr("00403327")
    enc_addr2 =  enc_addr
    enc_addr3 = enc_addr
    enc = get_bytes(enc_addr, 0xB0)
    xorKey = 0x74f56265
    for i in range(0x2c):
            clearListing(enc_addr3)
            enc_addr3 = enc_addr3.add(1)
            
    for i in range(0, 0xB0, 4):
        temp = enc[i:i+4]
        temp = struct.unpack('<I', temp )[0]
        temp = temp ^ xorKey
        enc[i:i+4] = bytearray(struct.pack('<I', temp))
        
    

    for i in enc:
        setByte(enc_addr, i)
        enc_addr = enc_addr.add(1)
        
        
        
        
    dis.disassemble(enc_addr2, None)
    

    


        
    
def api_hashing():
    api_list = ["OpenProcessToken",
        "CreateProcessA",
        "CreateProcessW",
        "NtCreateUserProcess",
        "GetTokenInformation",
        "ShellExecuteA",
        "ShellExecuteW",
        "NtTerminateProcess",
        "LdrLoadDll",
        "LoadLibraryA",
        "LoadLibraryW",
        "VirtualAlloc",
        "GetProcAddress",
        "NtClose",
        "RtlInitUnicodeString",
        "RtlZeroMemory",
        "GetModuleHandleA",
        "WriteProcessMemory",
        "Sleep",
        "GetModuleFileNameW",
        "ExpandEnvironmentStringsW",
        "lstrcatW",
        "VirtualProtect",
        "CreateFileA",
        "CreateFileW",
        "CreateFileMappingW",
        "MapViewOfFile",
        "LocalAlloc",
        "LocalFree",
        "GetForegroundWindow",
        "GetShellWindow",
        "GetWindowThreadProcessId",
        "wsprintfW",
        "GetKeyboardLayoutList",
        "ShellExecuteW",
        "Empty",
        "NtOpenProcess",
        "NtCreateSection",
        "NtMapViewOfSection",
        "NtAllocateVirtualMemory",
        "NtDuplicateObject",
        "NtQuerySystemInformation",
        "NtQueryInformationProcess",
        "RtlCreateUserThread"
        ]
    hasher = 0x1505
    hash2 = 0
    for a in api_list:
            hasher = 0x1505
            hash2 = 0
            for i in a:
                i = ord(i)
                hash2 = hasher
                hasher = hasher << 5
                hasher = hasher & 0xFFFFFFFF
                hasher = hasher + hash2
                hasher = hasher & 0xFFFFFFFF
                hasher = hasher + i
                hasher = hasher & 0xFFFFFFFF
            
            hash2 = hasher
            hasher = hasher << 5
            hasher = hasher & 0xFFFFFFFF
            hasher = hasher + hash2
            hasher = hasher & 0xFFFFFFFF
        
           
            hasher2 = hex(hasher)[2:-1]
            if len(hasher2)!= 8:
                hasher2 = "0"+hasher2
                
            pattern = '\\x{}\\x{}\\x{}\\x{}'.format(hasher2[6:8],hasher2[4:6],hasher2[2:4],hasher2[0:2])
            addresss = findBytes( currentProgram.getMinAddress(), pattern)
            if addresss != None:
                    setEOLComment(addresss, a)
                    print(addresss)
                    createBookmark(addresss, "API", a)
                    
        
  
