def createStruct():
    api_struct = StructureDataType(CategoryPath("/struct"),"API_HASH_ORDER", 0xB0 )
    api_resolving_order = [
    "NtTerminateProcess",
    "NtClose",
    "LdrLoadDll",
    "RtlInitUnicodeString",
    "RtlZeroMemory",
    "Empty",
    "GetModuleHandleA",
    "Sleep",
    "GetModuleFileNameW",
    "ExpandEnvironmentStringW",
    "lstrcatw",
    "CreateFileW",
    "CreateFileMappingW",
    "MapViewofFile",
    "LocalAlloc",
    "LocalFree",
    "Empty",
    "GetForegroundWindow",
    "GetShellWindow",
    "GetWindowThreadProcessId",
    "wsprintfW",
    "GetKeyboardLayoutList",
    "Empty",
    "OpenProcessToken",
    "GetTokenInformation"
    "Empty",
    "ShellExecuteW",
        "Empty",
        "NtOpenProcess",
        "NtCreateSection",
        "NtMapViewOfSection",
        "NtAllocateVirtualMemory",
        "NtDuplicateObject",
        "NtQuerySystemInformation",
        "NtQueryInformationProcess"
    ] 
    j = 0
    for api in api_resolving_order:
        api_struct.replaceAtOffset(j,Pointer32DataType(), 4,api, api)
        j = j+4
        
    print("done Create Struct for API")
    dm.addDataType(api_struct, DataTypeConflictHandler.REPLACE_HANDLER)
    
def rol(number, count):
    result =  (number << count ) | ( number  >> (32 - count))
    return result
    
    
