def key_scheduling(key):
    key = bytearray(key)
    sched= []
    sched = [i for i in range(0,256)]
    i  = 0
    for j in range(0,256):
        i = ( i + sched[j] + key [  j % 4 ]) % 256
        tmp = sched[j]
        sched[j] = sched[i]
        sched[i] = tmp
    return sched

def streamXor(data, key, data_len, key_len, sched):
    counter = 0
    i = 0
    j = i
    while data_len !=0:
        i = i + 1
        i= i & 0xFF
        temp = sched[i]
        temp = temp & 0xFF
        j = j + temp
        j = j & 0xFF
        sched[i] = sched[j]
        sched[j] = temp
        sched_swap = sched[i] + temp
        sched_swap = sched_swap & 0xFF
        data[counter] = data[counter] ^ sched[sched_swap]
        counter = counter+1
        data_len = data_len -1

    return data
        
def customrc4(data, key, data_len, key_len):
    sched = key_scheduling(key)
    final_result = streamXor(data, key, data_len, key_len, sched)
    print(final_result)

